import React, { useState}from 'react'
import { Grid, Image,Card, Icon,Item, List, Divider, Container, Button, Label  } from 'semantic-ui-react'
import joblistData from './JobListData'

export default function JobCard(props) {
    return (
        <>
        {
            joblistData.map((item,index)=>(
                <Card>
                    <Image key={index} src={item.picture} wrapped ui={false} />
                <Card.Content>
                    <Card.Header id='title'>{item.company}</Card.Header>
                </Card.Content>
                <Card.Content extra>
                    <Icon name='map marker alternate' />{item.location}
                </Card.Content>
                </Card>
            ))
        }
        </>

    )


}
